local playerGui = game.Players.LocalPlayer:WaitForChild("PlayerGui")
local chatFrame = playerGui:FindFirstChild("Chat")

if chatFrame then
    local RunService = game:GetService("RunService")
    local endTime = tick() + 30

    local connection
    connection = RunService.RenderStepped:Connect(function()
        if tick() >= endTime then
            connection:Disconnect()
            return
        end

        for _, child in pairs(chatFrame:GetDescendants()) do
            if child:IsA("TextLabel") then
                child:Destroy()
            end
        end
    end)
end
    local function updateHub()
        local coreGui = game:GetService("CoreGui")

        local function findAndRenameDescendants(parent, oldName, newName)
            for _, child in ipairs(parent:GetDescendants()) do
                if child.Name == oldName then
                    child.Name = newName
                end
            end
        end

        local function findElementByName(parent, name)
            for _, child in ipairs(parent:GetDescendants()) do
                if child.Name == name then
                    return child
                end
            end
            return nil
        end

        local cokkaHub = findElementByName(coreGui, "Cokka Hub")
        if cokkaHub then
            local parent = cokkaHub.Parent
            parent.Name = "LuminHubOnTop"

            findAndRenameDescendants(parent, "FloatingCokka Hub", "FloatingLumin Hub")
            findAndRenameDescendants(parent, "Cokka Hub", "Lumin Hub")

            local floatingIcon = findElementByName(parent, "FloatingLumin Hub")
            if floatingIcon then
                floatingIcon.Image = "rbxassetid://120756524156554"
            end

            local title = parent:FindFirstChild("Lumin Hub", true)
            if title then
                local topFrame = title:FindFirstChild("TopFrame")
                if topFrame then
                    local titleLabel = topFrame:FindFirstChild("Title")
                    if titleLabel then
                        titleLabel.Text = "Lumin Hub"
                    end
                end
            end

            local tabFrame = parent:FindFirstChild("Lumin Hub", true):FindFirstChild("TabFrame")
            if tabFrame then
                local tabs = tabFrame:FindFirstChild("Tabs")
                if tabs then
                    local mainFarm = tabs:FindFirstChild("Main Farm")
                    if mainFarm then
                        local elementsToDelete = {
                            "My Discord (Click Copy)",
                            "My Youtube (Click Copy)",
                            "Listen to Lofi Music",
                            "Happy New Lover!"
                        }

                        for _, elementName in ipairs(elementsToDelete) do
                            local element = mainFarm:FindFirstChild(elementName)
                            if element then
                                element:Destroy()
                            end
                        end
                    end
                end
            end
        end
    end

    while true do
        updateHub()
        wait(0.1)
    end
